import React from "react";
import "../ComponentStyle/SwitchStyle.css";


function Switch() {
    return ( <
        div >
        <
        label class = "switch" >
        <
        input type = "checkbox" / >
        <
        span class = "slider round" > < /span> <
        /label> <
        /div>
    );
}

export default Switch;
